// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

interface IUserManager {
    function userExists(address user) external view returns (bool);
    function ownsUsername(address user, string calldata username) external view returns (bool);
    function isUserListed(address user) external view returns (bool);
    function getUserXP(address user) external view returns (uint256);
    function setListingStatus(address user, bool status) external;
    function transferUsername(string memory username, address oldOwner, address newOwner, uint256 xpSnapshot) external;
}

contract Marketplace is Ownable, ReentrancyGuard {
    
    struct AccountListing {
        address owner;
        uint256 price;
        uint256 xpSnapshot;
        bool active;
    }

    // Events
    event AccountListed(string indexed username, uint256 price, uint256 xp);
    event AccountSold(string indexed username, address indexed oldOwner, address indexed newOwner, uint256 price);
    event ListingCancelled(string indexed username);

    // State variables
    mapping(string => AccountListing) public accountListings;
    string[] public listedUsernames;
    
    IUserManager public userManager;
    address public mainContract;

    modifier onlyMainContract() {
        require(msg.sender == mainContract, "Only main contract");
        _;
    }

    constructor(address initialOwner, address _userManager) Ownable(initialOwner) {
        userManager = IUserManager(_userManager);
    }

    function setMainContract(address _mainContract) external onlyOwner {
        mainContract = _mainContract;
    }

    function listAccountForSale(string calldata username, uint256 price) 
        external 
        nonReentrant 
    {
        require(userManager.userExists(msg.sender), "User not registered");
        require(userManager.ownsUsername(msg.sender, username), "Not username owner");
        require(!userManager.isUserListed(msg.sender), "Account already listed");
        require(price > 0, "Price must be greater than 0");

        uint256 xpSnapshot = userManager.getUserXP(msg.sender);
        accountListings[username] = AccountListing({
            owner: msg.sender,
            price: price,
            xpSnapshot: xpSnapshot,
            active: true
        });

        userManager.setListingStatus(msg.sender, true);
        listedUsernames.push(username);

        emit AccountListed(username, price, xpSnapshot);
    }

    function buyAccount(string calldata username) 
        external 
        payable 
        nonReentrant 
    {
        AccountListing storage listing = accountListings[username];
        require(listing.active, "Account not listed");
        require(msg.value >= listing.price, "Insufficient payment");
        require(msg.sender != listing.owner, "Cannot buy own account");

        address oldOwner = listing.owner;
        uint256 price = listing.price;
        uint256 xpSnapshot = listing.xpSnapshot;

        // Transfer the account
        userManager.transferUsername(username, oldOwner, msg.sender, xpSnapshot);
        _removeListing(username);

        // Handle payment
        (bool success, ) = payable(oldOwner).call{value: price}("");
        require(success, "Payment failed");

        if (msg.value > price) {
            (bool refundSuccess, ) = payable(msg.sender).call{value: msg.value - price}("");
            require(refundSuccess, "Refund failed");
        }

        emit AccountSold(username, oldOwner, msg.sender, price);
    }

    function cancelListing(string calldata username) 
        external 
    {
        require(userManager.ownsUsername(msg.sender, username), "Not username owner");
        require(accountListings[username].active, "Account not listed");

        _removeListing(username);
        emit ListingCancelled(username);
    }

    function isAccountListed(string calldata username) external view returns (bool) {
        return accountListings[username].active;
    }

    function getListedAccounts() external view returns (
        string[] memory usernames,
        uint256[] memory xps,
        uint256[] memory prices
    ) {
        uint256 activeCount = 0;
        for (uint256 i = 0; i < listedUsernames.length; i++) {
            if (accountListings[listedUsernames[i]].active) {
                activeCount++;
            }
        }

        usernames = new string[](activeCount);
        xps = new uint256[](activeCount);
        prices = new uint256[](activeCount);

        uint256 idx = 0;
        for (uint256 i = 0; i < listedUsernames.length; i++) {
            string memory username = listedUsernames[i];
            AccountListing memory listing = accountListings[username];
            if (listing.active) {
                usernames[idx] = username;
                xps[idx] = listing.xpSnapshot;
                prices[idx] = listing.price;
                idx++;
            }
        }
    }

    function _removeListing(string memory username) internal {
        accountListings[username].active = false;
        userManager.setListingStatus(accountListings[username].owner, false);

        for (uint256 i = 0; i < listedUsernames.length; i++) {
            if (keccak256(bytes(listedUsernames[i])) == keccak256(bytes(username))) {
                listedUsernames[i] = listedUsernames[listedUsernames.length - 1];
                listedUsernames.pop();
                break;
            }
        }
    }
}

