// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

interface IUserManager {
    function userExists(address user) external view returns (bool);
    function isUserListed(address user) external view returns (bool);
    function updateXP(address user, uint256 xpToAdd) external;
}

contract MatchManager is Ownable, ReentrancyGuard {
    
    struct Match {
        address player1;
        address player2;
        uint256 stakeAmount;
        bool active;
    }

    struct PendingMatch {
        address player1;
        address player2;
        uint256 stakeAmount;
        bool exists;
    }

    // Events
    event MatchInitiated(address indexed player1, address indexed player2, uint256 stakeAmount);
    event MatchStarted(bytes32 indexed matchId, address indexed player1, address indexed player2, uint256 stakeAmount);
    event MatchEnded(bytes32 indexed matchId, address indexed winner, address indexed loser, uint256 winnings);

    // State variables
    mapping(bytes32 => PendingMatch) public pendingMatches;
    mapping(bytes32 => Match) public activeMatches;
    mapping(address => uint256) public stakedAmounts;
    mapping(address => bool) public inMatch;
    
    IUserManager public userManager;
    
    uint256 public constant MIN_STAKE_AMOUNT = 0.001 ether;
    uint256 public constant XP_PER_WIN = 100;

    constructor(address initialOwner, address _userManager) Ownable(initialOwner) {
        userManager = IUserManager(_userManager);
    }

    function initiateMatch(address opponent) 
        external 
        payable 
        nonReentrant 
    {
        require(userManager.userExists(msg.sender), "User not registered");
        require(!inMatch[msg.sender], "Player already in match");
        require(opponent != msg.sender, "Cannot play yourself");
        require(userManager.userExists(opponent), "Opponent not registered");
        require(!userManager.isUserListed(msg.sender) && !userManager.isUserListed(opponent), "Accounts must not be listed");
        require(!inMatch[opponent], "Opponent already in match");
        require(msg.value >= MIN_STAKE_AMOUNT, "Stake too low");

        bytes32 matchRequestId = keccak256(abi.encodePacked(msg.sender, opponent));
        require(!pendingMatches[matchRequestId].exists, "Match already requested");

        stakedAmounts[msg.sender] = msg.value;

        pendingMatches[matchRequestId] = PendingMatch({
            player1: msg.sender,
            player2: opponent,
            stakeAmount: msg.value,
            exists: true
        });

        emit MatchInitiated(msg.sender, opponent, msg.value);
    }

    function acceptMatch(address player1) 
        external 
        payable 
        nonReentrant 
    {
        require(userManager.userExists(msg.sender), "User not registered");
        require(!inMatch[msg.sender], "Player already in match");

        bytes32 matchRequestId = keccak256(abi.encodePacked(player1, msg.sender));
        PendingMatch storage request = pendingMatches[matchRequestId];
        require(request.exists, "No match request found");
        require(request.player1 == player1 && request.player2 == msg.sender, "Invalid match request");
        require(msg.value == request.stakeAmount, "Stake must match player1's stake");

        bytes32 activeMatchId = keccak256(abi.encodePacked(player1, msg.sender, block.timestamp));

        activeMatches[activeMatchId] = Match({
            player1: player1,
            player2: msg.sender,
            stakeAmount: request.stakeAmount,
            active: true
        });

        inMatch[player1] = true;
        inMatch[msg.sender] = true;

        stakedAmounts[msg.sender] = msg.value;

        delete pendingMatches[matchRequestId];

        emit MatchStarted(activeMatchId, player1, msg.sender, msg.value);
    }

    function submitWinner(bytes32 matchId, address winner) 
        external 
        nonReentrant 
    {
        Match storage gameMatch = activeMatches[matchId];
        require(gameMatch.active, "Match not active");
        require(winner == gameMatch.player1 || winner == gameMatch.player2, "Invalid winner");
        require(msg.sender == gameMatch.player1 || msg.sender == gameMatch.player2, "Not a player in this match");

        address loser = (winner == gameMatch.player1) ? gameMatch.player2 : gameMatch.player1;
        uint256 totalWinnings = gameMatch.stakeAmount * 2;

        gameMatch.active = false;

        inMatch[gameMatch.player1] = false;
        inMatch[gameMatch.player2] = false;
        stakedAmounts[gameMatch.player1] = 0;
        stakedAmounts[gameMatch.player2] = 0;

        userManager.updateXP(winner, XP_PER_WIN);

        (bool success, ) = payable(winner).call{value: totalWinnings}("");
        require(success, "Winnings transfer failed");

        emit MatchEnded(matchId, winner, loser, totalWinnings);
    }

    function isInMatch(address player) external view returns (bool) {
        return inMatch[player];
    }

    function getMatchId(address player1, address player2) external view returns (bytes32) {
        return keccak256(abi.encodePacked(player1, player2));
    }
}

