// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

interface IUserManager {
    function registerUser(string calldata username) external;
    function getUserProfile(address user) external view returns (string memory, uint256, bool, bool, bool);
    function getUsername(address user) external view returns (string memory);
    function getAddress(string calldata username) external view returns (address);
    function getUserXP(address user) external view returns (uint256);
    function setActiveUsername(address user, string calldata username) external;
    function getMyUsernames() external view returns (string[] memory);
}

interface IMarketplace {
    function listAccountForSale(string calldata username, uint256 price) external;
    function buyAccount(string calldata username) external payable;
    function cancelListing(string calldata username) external;
    function getListedAccounts() external view returns (string[] memory, uint256[] memory, uint256[] memory);
}

interface IMatchManager {
    function initiateMatch(address opponent) external payable;
    function acceptMatch(address player1) external payable;
    function submitWinner(bytes32 matchId, address winner) external;
    function isInMatch(address player) external view returns (bool);
    function getMatchId(address player1, address player2) external view returns (bytes32);
}

contract ShadowFightGameDApp is Ownable, ReentrancyGuard {
    
    IUserManager public userManager;
    IMarketplace public marketplace;
    IMatchManager public matchManager;

    constructor(
        address initialOwner,
        address _userManager,
        address _marketplace,
        address _matchManager
    ) Ownable(initialOwner) {
        userManager = IUserManager(_userManager);
        marketplace = IMarketplace(_marketplace);
        matchManager = IMatchManager(_matchManager);
    }

    // Delegate functions to respective contracts
    function registerUser(string calldata username) external {
        userManager.registerUser(username);
    }

    function listAccountForSale(string calldata username, uint256 price) external {
        require(!matchManager.isInMatch(msg.sender), "Cannot list while in match");
        marketplace.listAccountForSale(username, price);
    }

    function buyAccount(string calldata username) external payable {
        marketplace.buyAccount{value: msg.value}(username);
    }

    function cancelListing(string calldata username) external {
        marketplace.cancelListing(username);
    }

    function initiateMatch(address opponent) external payable {
        matchManager.initiateMatch{value: msg.value}(opponent);
    }

    function acceptMatch(address player1) external payable {
        matchManager.acceptMatch{value: msg.value}(player1);
    }

    function submitWinner(bytes32 matchId, address winner) external {
        matchManager.submitWinner(matchId, winner);
    }

    function setActiveUsername(string calldata username) external {
        require(!matchManager.isInMatch(msg.sender), "Cannot switch while in match");
        userManager.setActiveUsername(msg.sender, username);
    }

    // View functions
    function getUserProfile(address user) external view returns (
        string memory username,
        uint256 xp,
        bool exists,
        bool isListed,
        bool currentlyInMatch
    ) {
        (username, xp, exists, isListed,) = userManager.getUserProfile(user);
        currentlyInMatch = matchManager.isInMatch(user);
    }

    function getUsername(address user) external view returns (string memory) {
        return userManager.getUsername(user);
    }

    function getAddress(string calldata username) external view returns (address) {
        return userManager.getAddress(username);
    }

    function getMyUsernames() external view returns (string[] memory) {
        return userManager.getMyUsernames();
    }

    function getXP(string calldata username) external view returns (uint256) {
        address user = userManager.getAddress(username);
        return userManager.getUserXP(user);
    }

    function getListedAccounts() external view returns (
        string[] memory usernames,
        uint256[] memory xps,
        uint256[] memory prices
    ) {
        return marketplace.getListedAccounts();
    }

    function getMatchId(address player1, address player2) external view returns (bytes32) {
        return matchManager.getMatchId(player1, player2);
    }

    // Admin functions
    function emergencyWithdraw() external onlyOwner {
        (bool success, ) = payable(owner()).call{value: address(this).balance}("");
        require(success, "Emergency withdrawal failed");
    }

    function getContractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    receive() external payable {}

    fallback() external payable {
        revert("Function not found");
    }
}

contracts/UserManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract UserManager is Ownable, ReentrancyGuard {

    struct UserProfile {
        string username;
        uint256 xp;
        bool exists;
        bool isListed;
    }

    // Events
    event UserRegistered(address indexed user, string username);
    event XPUpdated(address indexed user, string username, uint256 newXP);
    event ActiveUsernameChanged(address indexed user, string username);

    // State variables
    mapping(address => UserProfile) public userProfiles;
    mapping(string => address) public usernameToAddress;
    mapping(address => string[]) public userOwnedUsernames;
    mapping(address => string) public activeUsername;

    // Authorized contracts
    mapping(address => bool) public authorizedContracts;

    // Constants
    uint256 public constant MIN_USERNAME_LENGTH = 3;
    uint256 public constant MAX_USERNAME_LENGTH = 20;

    modifier onlyAuthorized() {
        require(authorizedContracts[msg.sender] || msg.sender == owner(), "Not authorized");
        _;
    }

    modifier validUsername(string memory username) {
        require(bytes(username).length >= MIN_USERNAME_LENGTH, "Username too short");
        require(bytes(username).length <= MAX_USERNAME_LENGTH, "Username too long");
        require(isValidUsernameFormat(username), "Invalid username format");
        _;
    }

    constructor(address initialOwner) Ownable(initialOwner) {}

    function authorizeContract(address contractAddr) external onlyOwner {
        authorizedContracts[contractAddr] = true;
    }

    function revokeContract(address contractAddr) external onlyOwner {
        authorizedContracts[contractAddr] = false;
    }

    function registerUser(string calldata username) 
        external 
        validUsername(username) 
    {
        require(!userProfiles[msg.sender].exists, "User already registered");
        require(usernameToAddress[username] == address(0), "Username already taken");

        userProfiles[msg.sender] = UserProfile({
            username: username,
            xp: 0,
            exists: true,
            isListed: false
        });

        usernameToAddress[username] = msg.sender;
        userOwnedUsernames[msg.sender].push(username);
        activeUsername[msg.sender] = username;

        emit UserRegistered(msg.sender, username);
    }

    function updateXP(address user, uint256 xpToAdd) external onlyAuthorized {
        require(userProfiles[user].exists, "User not registered");
        userProfiles[user].xp += xpToAdd;
        emit XPUpdated(user, userProfiles[user].username, userProfiles[user].xp);
    }

    function setListingStatus(address user, bool status) external onlyAuthorized {
        require(userProfiles[user].exists, "User not registered");
        userProfiles[user].isListed = status;
    }

    function setActiveUsername(address user, string calldata username) external {
        require(msg.sender == user || authorizedContracts[msg.sender], "Not authorized");
        require(usernameToAddress[username] == user, "Don't own this username");
        activeUsername[user] = username;
        emit ActiveUsernameChanged(user, username);
    }

    // View functions
    function userExists(address user) external view returns (bool) {
        return userProfiles[user].exists;
    }

    function isUserListed(address user) external view returns (bool) {
        return userProfiles[user].isListed;
    }

    function getUserXP(address user) external view returns (uint256) {
        return userProfiles[user].xp;
    }

    function getUsername(address user) external view returns (string memory) {
        return userProfiles[user].username;
    }

    function getAddress(string calldata username) external view returns (address) {
        return usernameToAddress[username];
    }

    function getActiveUsername(address user) external view returns (string memory) {
        return activeUsername[user];
    }

    function ownsUsername(address user, string calldata username) external view returns (bool) {
        return usernameToAddress[username] == user;
    }

    function getUserProfile(address user) external view returns (
        string memory username,
        uint256 xp,
        bool exists,
        bool isListed,
        bool currentlyInMatch
    ) {
        UserProfile memory profile = userProfiles[user];
        return (
            profile.username,
            profile.xp,
            profile.exists,
            profile.isListed,
            false // This will be handled by main contract
        );
    }

    function getMyUsernames() external view returns (string[] memory) {
        return userOwnedUsernames[msg.sender];
    }

    function transferUsername(string memory username, address oldOwner, address newOwner, uint256 xpSnapshot) external onlyAuthorized {
        usernameToAddress[username] = newOwner;

        // Remove from old owner
        string[] storage oldOwnerUsernames = userOwnedUsernames[oldOwner];
        for (uint256 i = 0; i < oldOwnerUsernames.length; i++) {
            if (keccak256(bytes(oldOwnerUsernames[i])) == keccak256(bytes(username))) {
                oldOwnerUsernames[i] = oldOwnerUsernames[oldOwnerUsernames.length - 1];
                oldOwnerUsernames.pop();
                break;
            }
        }

        // Add to new owner
